const background = '#707B7C';
const statusBar = '#FFF';
const primary = '#3366FF';
const topNavText = '#000';
const inActiveTab = 'rgb(143, 155, 179)';
const ActiveTab = '#000';
export default {
	background,
	primary,
	topNavText,
	ActiveTab,
	inActiveTab,
	statusBar,
};
